def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    ratios = item / bins
    priorities = np.zeros_like(bins)

    for i, ratio in enumerate(ratios):
        if ratio < 0.2:
            priorities[i] = 1 / (1 + np.exp(-10 * (ratio - 0.2)))
        elif ratio >= 0.2 and ratio < 0.5:
            priorities[i] = 0.8 / (1 + np.exp(-10 * (ratio - 0.3)))
        elif ratio >= 0.5 and ratio < 0.7:
            priorities[i] = 0.6 / (1 + np.exp(-10 * (ratio - 0.6)))
        elif ratio >= 0.7 and ratio < 0.9:
            priorities[i] = 0.4 / (1 + np.exp(-10 * (ratio - 0.8)))
        else:
            priorities[i] = 0.2 / (1 + np.exp(-10 * (ratio - 1.0)))

        if i % 4 == 0:
            priorities[i] += 0.1
        elif i % 4 == 1:
            priorities[i] -= 0.05
        elif i % 4 == 2:
            priorities[i] += 0.02
        else:
            priorities[i] -= 0.03

    return priorities
